import React from 'react';
import './Home.css';
import banner from '../images/jacques-bopp-Hh18POSx5qk-unsplash.jpg';

const Home = () => {
  return (
    <div className='container-fluid row'>
        <div className='col-6 banner-left'>

        </div>

        <div className='col-6 banner-right'>
        <img src={banner} alt="" width="50%"/>
        </div>
    </div>
  )
}

export default Home
